import logo from './logo.svg';
import './Login.css';

import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
Box,
} from "@material-ui/core";

function Login() {
  return (
    <div>
      <Grid>
        <Paper variant="elevation" elevation={50} className="login-background">
          Sign in
        </Paper>
      </Grid>
  </div>
  );
}

export default Login;
